fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rock_constituent rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :rock ;
            owl:onProperty :has_substance ],
        :constituent .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:active_continent rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :continental_lithosphere ;
            owl:onProperty :part_of ],
        :geologic_province .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continental_crust rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :continental_lithosphere ;
            owl:onProperty :part_of ],
        [ a owl:Restriction ;
            owl:onProperty :has_rock ;
            owl:someValuesFrom :felsic ],
        :continental,
        :crust,
        :skin_layer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continental_lithosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :craton ;
            owl:onProperty :has_planetary_structure ],
        :continental,
        :lithosphere .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:craton rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :shield ;
            owl:onProperty :has_planetary_structure ],
        [ a owl:Restriction ;
            owl:allValuesFrom :kimberlite ;
            owl:onProperty :has_substance ],
        [ a owl:Restriction ;
            owl:allValuesFrom :intracratonic_basin ;
            owl:onProperty :has_planetary_structure ],
        [ a owl:Restriction ;
            owl:allValuesFrom :continental_crust ;
            owl:onProperty :part_of ],
        [ a owl:Restriction ;
            owl:allValuesFrom :continental_platform ;
            owl:onProperty :has_planetary_structure ],
        :geologic_province .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stable_continent rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :continental_lithosphere ;
            owl:onProperty :part_of ],
        :geologic_province .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:supercontinent rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :craton ;
            owl:onProperty :has_planetary_structure ],
        [ a owl:Restriction ;
            owl:allValuesFrom :continental_lithosphere ;
            owl:onProperty :has_realm ],
        :geologic_province .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:magmatic_arc rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :arc_axis ;
            owl:onProperty :has_axis ],
        [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :rear_arc ],
        [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :fore_arc ],
        :arc .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orogen rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :suture ],
        [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :foreland_basin ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenomena ;
            owl:someValuesFrom :orogenic_collapse ],
        [ a owl:Restriction ;
            owl:onProperty :has_substance ;
            owl:someValuesFrom :melange ],
        [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :thrust_system ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenomena ;
            owl:someValuesFrom :deformation ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenomena ;
            owl:someValuesFrom :orogeny ],
        [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :terrane ],
        :geologic_province .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aquifer rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :saturated_zone ;
            owl:onProperty :part_of ],
        :hydrosphere_feature .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:confined_aquifer rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :confined ;
            owl:onProperty :has_spatial_configuration ],
        :aquifer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:confined_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :confined ;
            owl:onProperty :has_spatial_configuration ],
        :hydrosphere_feature .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:confined_unit rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :confined ;
            owl:onProperty :has_spatial_configuration ],
        :hydrosphere_feature .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:confined_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :confined ;
            owl:onProperty :has_spatial_configuration ],
        :hydrosphere_feature .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:saturated_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :aquifer ;
            owl:onProperty :part_of ],
        :hydrosphere_feature .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:unconfined_aquifer rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :unconfined ;
            owl:onProperty :has_spatial_configuration ],
        :aquifer ;
    owl:equivalentClass :water_table_aquifer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:underground_water rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :vadose_zone ;
