        :groundwater .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:estuary rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :sediment ;
            owl:onProperty :has_substance ],
        [ a owl:Restriction ;
            owl:onProperty :has_substance ;
            owl:someValuesFrom :brackish_water ],
        :body_of_water .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fjord rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :glacier ;
            owl:onProperty :has_realm ],
        [ a owl:Restriction ;
            owl:allValuesFrom :valley ;
            owl:onProperty :has_realm ],
