            owl:onProperty :has_substance ],
        :wetland .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:swamp rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :vegetation ;
            owl:onProperty :has_species ],
        [ a owl:Restriction ;
            owl:hasValue :saturation ;
            owl:onProperty :has_state ],
        :wetland .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_body_boundary rdfs:subClassOf [ a owl:Restriction ;
