        :parkland .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:county_park rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :county ;
            owl:onProperty :has_jurisdiction ],
