@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:national_monument rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :country ;
            owl:onProperty :has_jurisdiction ],
        :land_reserve .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:national_park rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :country ;
            owl:onProperty :has_jurisdiction ],
        :park,
        :parkland .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:state_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :state ;
